    "description" : "यस खण्‍डमा बतासलाई जनाउने शब्‍दहरू प्रयोग गर्नुहोस्‌। कुनैकुनै शब्दहरूले हावा शुरु हुनु र अन्य हुनुलाई जनाउँछन्। हावा यसको गतिमा परिवर्तन हुन्छ। त्यसैले केही शब्दहरूले हावा कत्तिको द्रुत छ भन्ने जनाउँछन्। यसमा हावाको एकदमै मन्द गतिबाट एकदमै द्रुत गतिलाई नाप्‍ने प्रयास गर्नुहोस्। यसप्रकारका शब्दहरू हावाले गर्ने क्रियाकलापको आधारमा पनि भिन्न हुन सक्छन्। प्राय: द्रुतगतिको हावाले धेरै कार्य गर्छ। एउटा स्थिर गतिको हावा चाहिँ कुनै निश्‍चित दिशातिर चलेको हुन्छ। यस्तो मापन कुनै कम्पासको कुनै बिन्दुले, वा कुनै छिमेकमा रहेका भौगोलिक स्थान व विशेषताहरूले, वा वक्ता हिँडेको स्थानले निर्धारण गर्दछन्। कुनैकुनै शब्दहरू चाहिँ हावाको भुमरिलाई जनाउने, धुलोको डल्ला बनाउने कार्यलाई जनाउने, सोली आकारको वादल बनाउने कार्यलाई जनाउने पनि हुन्छन्। कुनैकुनै शब्दहरू चाहिँ हावाले के गर्छ भन्ने जनाउन प्रयोग हुन्छन्। उदाहरणका लागि हावाले केहीचिज उडाउँछ वा ड्यामेज गराउँछ। मान्छेहरूले (चीसो, तातो भनी) हावाको अनुभव पनि गर्दछन्। त्यसैले कुनैकुनै शब्दहरू चाहिँ यस प्रकारको अनुभव जनाउन प्रयोग हुन्छन्। हावाबाट आवाज पनि आउँछ। त्यसैले कुनैकुनै शब्दहरूले हावाको यस आवाजलाई जनाउँछन्। कुनैकुनै संस्कृतिमा हावा र आत्माको सम्बन्ध पनि हुन्छ। त्यसैले कुनैकुनै शब्दहरूले हावाको आत्माको क्रियाकलाप जनाउन सक्छन्। वा हावाले ल्याउने रोगहरू पनि हुन सक्छन्।",
