    "description" : "यस खण्‍डमा भाले र पोथी पशुहरू जनाउने शब्‍दहरू प्रयोग गर्नुहोस्‌। धेरै भाषामा घरपालुवा जनावरहरूका लागि मात्र भाले र पोथी जनाउने शब्दहरू प्रयोग हुने गरेको पाइन्छ। कहिलेकाहिँ भालेका लागि प्रयोग हुने शब्दहरू पाइन्छन् तर पोथिका लागि प्रयोग हुने शब्दहरू पाइँदैनन्। वा कहिलेकाहिँ यसको उल्टो पनि हुन्छ। कहिलेकाहिँ एउटै शब्दले दुबै (भाले र पोथी) जनाउने पनि हुन्छ।",
