    "description" : "यो खण्‍डमा कुनै व्‍यक्ति वा वस्‍तुलाई निश्चितरूपमा नजनाए पनि कसैलाई वा कुनै वस्‍तुलाई अनिश्चितरूपमा जनाउने सर्वनामहरू प्रयोग गर्नुहोस्‌। केही भाषामा तल प्रस्तुत गरिएका सर्वनाम समुह नहुन सक्छन्। तपाईँले आफ्नो भाषामा पहिल्याउनु भएका सबै सर्वनाम चार्टमा समावेश गर्नुहोस्।",
