    "description" : "कुनै एउटा क्रियाकलापको ‘कर्म’ मा केही सहभागिता जनाउने शब्‍दहरू यो भाग प्रयोग गर्नुहोस्‌। ‘प्यासेन्ट’ जहिले पनि वाक्‍यको कर्मको रुपमा प्रस्‍तुत गरिन्‍छ।",
